import HeaderGeneral from './componentes/HeaderGeneral/index.js'
import styled from 'styled-components';

const AppContainer = styled.div`
  .App {
    width: 100vw;
    height: 100vh;
    background-image: linear-gradient(90deg, #002F52 35%, #326589);
  }
  li {
    list-style: none;
  }
`

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HeaderGeneral/>
      </header>
    </div>
  );
}

export default App;
